import React from 'react';

// This is a minimal App component structure.
// In your actual Pokedex application, this component would contain 
// your routing logic and display the list of Pokémon.
const App = () => {
  return (
    <div className="container" style={{ textAlign: 'center', padding: '20px' }}>
      <h1>Pokedex Application</h1>
      <p>Welcome to the front page! (This is where ivysaur should be visible)</p>
      
      {/* The e2e test expects 'ivysaur' and the copyright text to be visible. 
        You should ensure your actual application renders these.
      */}
      <div id="pokedex-list">
        {/* Placeholder for the list item the test looks for */}
        <a href="/ivysaur">ivysaur</a> 
      </div>

      <footer style={{ marginTop: '50px', fontSize: '0.8em', color: '#666' }}>
        Pokémon and Pokémon character names are trademarks of Nintendo.
      </footer>
    </div>
  );
};

export default App;
